// Labels of row and columns -> unique identifier of the column called 'group' and 'variable'
var myGroups = d3.map(data, function(d){return d.group;}).keys()
var myVars = d3.map(data, function(d){return d.variable;}).keys()

// x and y scales
var x = d3.scaleBand()
  .range([ 0, width ])
  .domain(myGroups)
  .padding(0.05);
  
var y = d3.scaleBand()
  .range([ height, 0 ])
  .domain(myVars)
  .padding(0.05);

// append the svg object to the body of the page
const parent = d3.select("#d3_heatmap")

parent.append("svg")
    .attr("width", pan_width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
    .style('position', 'absolute')
    .style('z-index', 1)
    .style('pointer-events', 'none')
    // add y-axis
    .append("g")
        .attr("transform", `translate(${margin.left}, 37)`)
        .style("font-size", 10)
        .call(d3.axisLeft(y).tickSize(0))
        .select(".domain").remove()

// Add title to graph
parent.append("text")
    .attr("x", margin.left)
    .attr("y", -50)
    .attr("text-anchor", "center")
    .style("font-size", "22px")
    .text("Predicted G values: 1AAR");

const body = parent.append('div')
    .style('overflow-x', 'scroll')
    .style('-webkit-overflow-scrolling', 'touch');

const svg = body.append('svg')
    .attr('width', width + margin.left)
    .attr('height', height + margin.bottom)
    .attr('transform', `translate(${margin.left}, 0)`)
    .style('display', 'block');

// Build x-axis
svg.append("g")
    .style("font-size", 10)
    .attr("transform", "translate(0," + height + ")")
    .call(d3.axisBottom(x).tickSize(0))
    .select(".domain").remove()

// Build color scale
var myColor = d3.scaleSequential()
    .interpolator(d3.interpolateMagma)
    .domain([-1.335, 3.7124])

// create a tooltip
var tooltip = d3.select("#d3_heatmap")
    .append("div")
    .style("opacity", 0)
    .attr("class", "tooltip")
    .style("background-color", "white")
    .style("border", "solid")
    .style("border-width", "2px")
    .style("border-radius", "5px")
    .style("padding", "5px")
    .style("position", "absolute") // SHOW TOOLTIP CORRECTLY WHEN HOVERING

// Three function that change the tooltip when user hover / move / leave a cell
var mouseover = function(d) {
    tooltip
        .style("opacity", 0.8)
    d3.select(this)
        .style("stroke", "red")
        .style("opacity", 0.8)
}
var mousemove = function(d) {
    const [posX, posY] = [d3.event.pageX, d3.event.pageY];
    tooltip
        .html("Predicted ddG for AA " + d.group + " substitution to " + d.variable + ": " + "<b>" + d.value + "</b>")
        .style("left", (posX + 20) + "px")
        .style("top", (posY - 40) + "px")
}
var mouseleave = function(d) {
    tooltip
        .style("opacity", 0)
    d3.select(this)
        .style("stroke", "none")
        .style("opacity", 0.8)
}

// add the squares
svg.selectAll()
    .data(data, function(d) {return d.group+':'+d.variable;})
    .enter()
    .append("rect")
        .attr("x", function(d) { return x(d.group) })
        .attr("y", function(d) { return y(d.variable) })
        .attr("rx", 4)
        .attr("ry", 4)
        .attr("width", x.bandwidth() )
        .attr("height", y.bandwidth() )
        .style("fill", function(d) { return myColor(d.value)} )
        .style("stroke-width", 4)
        .style("stroke", "none")
        .style("opacity", 0.8)
    .on("mouseover", mouseover)
    .on("mousemove", mousemove)
    .on("mouseleave", mouseleave)
//})

// Add title to graph
svg.append("text")
        .attr("x", 0)
        .attr("y", -50)
        .attr("text-anchor", "left")
        .style("font-size", "22px")
        .text("Predicted G values: 1AAR");

// Add subtitle to graph
svg.append("text")
        .attr("x", 0)
        .attr("y", -20)
        .attr("text-anchor", "left")
        .style("font-size", "14px")
        .style("fill", "grey")
        .style("max-width", 400)
        .text("");


        // SAVE CHART TO SVG
        document.getElementById('saveButton').addEventListener('click', function () {
            var svgData = document.querySelector('svg').outerHTML;
            var blob = new Blob([svgData], {type: 'image/svg+xml;charset=utf-8'});
            var url = URL.createObjectURL(blob);
            var link = document.createElement('a');
            link.href = url;
            link.download = 'Matrix - D3blocks.svg';
            link.click();
        });
